import { TeamServices } from '../services/teams';

export class TeamController {
  static list = async (req: any, res: any, next: any) => {
    try {
      const result = await TeamServices.list(req.query, req.ctx);
      res.json(result);
    } catch (error) {
      next(error)
    }
  }

  static updateTeamMetadata = async (req: any, res: any, next: any) => {
    try {
      const result = await TeamServices.updateTeamMetadata(req.body, req.ctx);
      res.json(result);
    } catch (error) {
      next(error)
    }
  }

  static listWOValue = async (req: any, res: any, next: any) => {
    try {
      const result = await TeamServices.listWOValue(req.query, req.ctx);
      res.json(result);
    } catch (error) {
      next(error)
    }
  }

  static fetch = async (req: any, res: any, next: any) => {
    try {
      const result = await TeamServices.fetch(req.query, req.ctx);
      res.json(result);
    } catch (error) {
      next(error)
    }
  }


  static fetchTeamIdTransfermarkt = async (req: any, res: any, next: any) => {
    try {
      const result = await TeamServices.fetchTeamIdTransfermarkt(req.query, req.ctx);
      res.json(result);
    } catch (error) {
      next(error)
    }
  }

  static listTeamMetaData = async (req: any, res: any, next: any) => {
    try {
      const result = await TeamServices.listTeamWithTranfermarkId(req.query, req.ctx);
      res.json(result);
    } catch (error) {
      next(error)
    }
  }

  static teamStats = async (req: any, res: any, next: any) => {
    try {
      const result = await TeamServices.getTeamStats(req.query, req.ctx);
      res.json(result);
    } catch (error) {
      next(error)
    }
  }

  static fetchTeamMetadata = async (req: any, res: any, next: any) => {
    try {
      const result = await TeamServices.fetchTeamMetadata(req.params.id, req.ctx)
      res.json(result)
    } catch (error) {
      next(error)
    }
  }
}

