import { getModels } from '../models/db.tables';
import { MySQLClient, Op } from '../clients/mysql';
import { map, compact, sumBy } from 'lodash';
// import { getPlayersValueUsd } from './players';
import { BadRequestError, NotFoundError } from '../utils/errors';

const { RawPlayerHistoryPerGame, TeamMetaData, TeamsTransfermarkt } = getModels(MySQLClient);

export class TeamServices {
  static list = async (params: any, ctx: any) => {
    const limit = parseInt(params.limit, 10) || 25;
    const offset = parseInt(params.offset, 10) || 0;
    const { sortBy, direction, tournamentId, seasonName } = params;
    const query = params.q;
    let where: any = {};

    if (!seasonName || isNaN(seasonName)) {
      throw new BadRequestError({ message: 'SeasonName is mandatory', field: 'seasonName' })
    }

    if (query) {
      where = {
        teamName: {
          [Op.like]: `%${query}%`
        }
      };
    }

    if (tournamentId) {
      where.tournamentId = parseInt(tournamentId, 10);
    }

    if (seasonName) {
      where.seasonName = {
        [MySQLClient.Op.like]: `${seasonName}%`
      }
    }

    const count = await RawPlayerHistoryPerGame.count({
      where,
      distinct: true,
      col: 'teamId'
    });

    const rows = await RawPlayerHistoryPerGame.findAll({
      where,
      attributes: ['teamId', 'teamName'],
      group: ['teamId', 'teamName'],
      limit,
      offset,
      order: sortBy && direction ? [[sortBy, direction]] : [['teamName', 'asc']],
      distinct: true,
      raw: true,
    });

    const teams = { rows, count };

    // await Promise.all(map(teams.rows, async (team: any) => {
    //   const players: any = await TeamServices.getPlayersFromTeam(team.teamId, seasonName);
    //   team.avgValue = await TeamServices.getTeamAvgValue(players.players)
    //   team.transfermarktTeamId = players.transfermarktTeamId
    // }));

    return teams;
  };

  static fetchTeamIdTransfermarkt = async (params: any, ctx: any) => {
    const { teamId } = params;
    const res = await MySQLClient.query(`SELECT transfermarktTeamId FROM teams_transfermarkt WHERE whoscoredTeamId = ${teamId}`, { type: MySQLClient.QueryTypes.SELECT });
    return res;
  }

  static listTeamWithTranfermarkId = async (params: any, ctx: any) => {
    const limit = parseInt(params.limit, 10) || 25;
    const offset = parseInt(params.offset, 10) || 0;
    const query = params.q;
    let where: {};

    if (query) {
      where = {
        name: {
          [Op.like]: `%${query}%`
        }
      }
    }
    const teams = await TeamsTransfermarkt.findAndCountAll({ where, offset, limit, raw: true });

    await Promise.all(map(teams.rows, async (t: any) => {
      const team = await RawPlayerHistoryPerGame.findOne({ where: { teamId: t.whoscoredTeamId } });
      t.teamName = team.teamName;

      const teamMetaData = await TeamMetaData.findOne({ where: { teamId: t.transfermarktTeamId } });
      if (teamMetaData) {
        t.presidentName = teamMetaData.presidentName;
        t.coachName = teamMetaData.coachName;
        t.teamLogo = teamMetaData.teamLogo;
        t.foundationDate = teamMetaData.foundationDate;
      }
    }));

    return teams;
  }



  // static getPlayersFromTeam = async (teamId: number, seasonName: string) => {
  //   const players = await MySQLClient.query(
  //     `SELECT playerId, name FROM raw_players_history_per_game 
  //     WHERE teamId = ${teamId} AND seasonName = ${seasonName}`, { type: MySQLClient.QueryTypes.SELECT }
  //   );
  //   const transfermarktTeam = await TeamsTransfermarkt.findOne({
  //     where: { whoscoredTeamId: teamId },
  //     attributes: ['transfermarktTeamId'],
  //     raw: true
  //   })
  //   const playersResult = await Promise.all(map(players, async (player) => {
  //     const valueUsd = await getPlayersValueUsd(player.playerId, seasonName);
  //     player.value = valueUsd.valueUsd
  //     return player;
  //   }))
  //   return { transfermarktTeamId: transfermarktTeam && transfermarktTeam.transfermarktTeamId, players: playersResult }
  // }

  static getTeamAvgValue = (players: any) => {
    return (sumBy(compact(map(players, 'value'))) / players.length) || 0;
  }

  static listWOValue = async (params: any, ctx: any) => {
    const limit = parseInt(params.limit, 10) || 25;
    const offset = parseInt(params.offset, 10) || 0;
    const { sortBy, direction, tournamentId, seasonName } = params;
    const query = params.q;
    let where: any = {};

    if (!seasonName || isNaN(seasonName)) {
      throw new BadRequestError({ message: 'SeasonName is mandatory', field: 'seasonName' })
    }

    if (query) {
      where = {
        teamName: {
          [Op.like]: `%${query}%`
        }
      };
    }

    if (tournamentId) {
      where.tournamentId = parseInt(tournamentId, 10);
    }

    if (seasonName) {
      where.seasonName = parseInt(seasonName, 10);
    }

    const count = await RawPlayerHistoryPerGame.count({
      where,
      distinct: true,
      col: 'teamId'
    });

    const rows = await RawPlayerHistoryPerGame.findAll({
      where,
      attributes: ['teamId', 'teamName'],
      group: ['teamId', 'teamName'],
      limit,
      offset,
      order: sortBy && direction ? [[sortBy, direction]] : [['teamName', 'asc']],
      distinct: true,
      raw: true,
    });

    const teams = { rows, count };

    return teams;
  }

  static fetch = async (params: any, ctx: any) => {
    const { teamId } = params;

    const team = await MySQLClient.query(
      `SELECT ts.*, tt.transfermarktTeamId FROM teams_stats ts INNER JOIN teams_transfermarkt tt ON ts.teamId = tt.whoscoredTeamId WHERE ts.teamId = ${teamId} AND ts.season = 2018`
      , { type: MySQLClient.QueryTypes.SELECT });

    return team[0];
  }

  static getTeamStats = async (params: any, ctx: any) => {
    const { user } = ctx;
    const { seasonName, teamId } = params;
    let listOfTeamId: any = null;

    const tournament = await MySQLClient.query(
      `SELECT tournamentId FROM raw_players_history_per_game WHERE teamId = ${teamId} AND tournamentId not in (12,30)`,
      { type: MySQLClient.QueryTypes.SELECT }
    );

    const tournamentId = tournament[0].tournamentId;

    const teamsOfTournament = await MySQLClient.query(
      `SELECT DISTINCT teamId FROM raw_players_history_per_game WHERE tournamentId = ${tournamentId} and seasonName = ${seasonName}`,
      { type: MySQLClient.QueryTypes.SELECT }
    );

    if (teamsOfTournament.length > 0) {
      listOfTeamId = JSON.stringify(map(teamsOfTournament, 'teamId')).replace('[', '(').replace(']', ')');
    }

    if (listOfTeamId) {
      const teamStats = await MySQLClient.query(
        `SELECT * FROM teams_stats WHERE teamId IN ${listOfTeamId} AND season = ${seasonName} ORDER BY rank ASC`,
        { type: MySQLClient.QueryTypes.SELECT }
      )

      await Promise.all(map(teamStats, async team => {
        const teamTranfersmarkt = await TeamsTransfermarkt.findOne({ where: { whoscoredTeamId: team.teamId }, raw: true });
        if (teamTranfersmarkt) {
          team.teamIdTranfersmarkt = teamTranfersmarkt.transfermarktTeamId;
        }
      }))

      return { tournamentId, teamStats };
    }
    return null;
  }

  static create = async (params: any) => {
    return TeamMetaData.create({
      teamId: params.teamId,
      presidentName: params.presidentName,
      coachName: params.coachName,
      foundationDate: params.foundationDate,
      teamLogo: params.teamLogo,
      listTrophy: params.listTrophy
    });

  };

  static updateTeamMetadata = async (params: any, ctx: any) => {
    const { teamId, presidentName, coachName, foundationDate, teamLogo, listTrophy } = params;
    return MySQLClient.transaction(async (transaction) => {
      const TeamMetaDataDB = await TeamMetaData.findOne({ where: { teamId }, transaction });
      if (!TeamMetaDataDB) {
        await TeamServices.create({ teamId, presidentName, coachName, foundationDate, teamLogo, listTrophy });
        return TeamMetaData.findOne({ where: { teamId } });
      }
      await TeamMetaDataDB.update({ ...params }, { where: { teamId }, transaction })

      return TeamMetaData.findOne({ where: { teamId }, transaction });
    })
  }

  static fetchTeamMetadata = async (teamId: any, ctx: any) => {
    const result = await TeamMetaData.findOne({
      where: { teamId },
      raw: true
    })
    if (!result) {
      return {
        teamId,
        presidentName: null,
        coachName: null,
        foundationDate: null,
      } as any;
    }
    return result
  }
}

