      },
      contractExpDate: {
        type: DataTypes.DATEONLY,
        allowNull: true
      },
      isAdmin: {
        type: DataTypes.BOOLEAN,
        defaultValue: 0,
      }
    },
    {
      tableName: 'users'
    }
  );
};

