) => {
  try {
    const jwt = await AuthServices.anonymous(req.ctx);
    res.json({ jwt });
  } catch (e) {
    next(e);
  }
};

export const fetch = async (req: any, res: any, next: any) => {
  try {
    res.json(req.ctx.jwt);
  } catch (e) {
    next(e);
  }
};

