  CoachesTeams: def.CoachesTeamsModel;
  PlayersAgents: def.PlayersAgentsModel;
  PlayersBestPosition: def.PlayersBestPositionModel;
}

let isInitialized = false;

export const getModels = (seq: sequelize.Sequelize): ITables => {
